import './App.css';

class App extends Component {
  state = {
    players: {
      player1 : 'Adam',
      player2 : 'Not Adam'}, 
      value : 'x'
  }
  /* const toggleSquare = () => {
    this.setState()

  }*/
  render() {
    return (
      <Container className="main">

      <Jumbotron>
    <h1>Tic Tac Toe!</h1>
       <p>
    I've invented a new game and I've named it Tic Tac Toe! Press Play below to give it a try!
  </p>
  <p>
    <button variant="primary">Learn more</button>
  </p>
</Jumbotron>
    <Board value="x" /></Container>

    );
  }
}

export default App;
